function 集体加血(加血距离X, 加血距离Y, 加血值)
{
   for(each in _root.gameworld)
   {
      if(_root.gameworld[each].是否为敌人 == _parent.是否为敌人)
      {
         if(Math.abs(_root.gameworld[each]._x - _parent._x) < 加血距离X and Math.abs(_root.gameworld[each]._y - _parent._y) < 加血距离Y)
         {
            if(_root.gameworld[each].hp > 0 and _root.gameworld[each].hp < _root.gameworld[each].hp满血值)
            {
               _root.gameworld[each].hp += _root.gameworld[each].hp满血值 * 0.02;
               if(_root.gameworld[each].hp > _root.gameworld[each].hp满血值)
               {
                  _root.gameworld[each].hp = _root.gameworld[each].hp满血值;
               }
               _root.效果("猩红增幅",_root.gameworld[each]._x,_root.gameworld[each]._y,100);
            }
         }
      }
   }
}
if(random(100) < 50)
{
   集体加血(900,600,100);
}
if(random(100) < 50)
{
   if(_parent.防御力 < _parent.基本防御力 * 10)
